INSERT INTO `partestrabajo_sl` (`idParteTrabajo`, `Asunto`, `FechaAlta`, `FechaVisita`, `Estado`, `cliente_id`, `Departamento`, `Observaciones`, `NFactura`, `descuentoParte`, `suma`, `ivaParte`, `totalParte`, `orden_id`, `trabajo_id`, `estadoVenta`, `solucion`, `hora_inicio`, `hora_fin`, `horas_trabajadas`, `precio_hora`, `desplazamiento`, `nombre_firmante`, `notas1`, `notas2`, `tituloParte`) VALUES
(1, 'COCHERAS NO DETECTA PRESENCIA.', '2024-10-14', '2024-10-15', '3', 1, 'COCHERAS', 'COCHERAS NO DETECTA PRESENCIA.', NULL, 0, 0, 21, 0, 1, 1, 2, 'salida cocheras no va bien debido a la humedad que hay a causa de las lluvias. Se desmonta, limpia el\r\nCto. y se vuelve a montar. Se hace comprobación de todo el sistema y se recomienda a la comunidad la\r\ninstalación de una célula detectora más cerca de la puerta.', '09:05:00', '10:14:00', 1.15, 0, 0, NULL, NULL, '', NULL),
(2, 'PROBLEMAS CON LAS LUCES DE LOS TRASTEROS', '2024-10-15', '2024-10-15', '3', 33, 'Trasteros', 'ninguna', NULL, 0, 66.13, 21, 80.0173, 2, 2, 1, 'Se hace revisión de las luces de los\r\ntrasteros y se observa 3 luminarias Estancas con tubos LEDS de los cortos ( 60 cm ) que no encienden.\r\nReparación de la 1° luminaria pasillo entrada a los trasteros y sustituir los 3 tubos LEDS. Uno en cada una\r\nde las luminarias que hay. Entrada, pasillo izda y pasillo derecha.', '10:21:00', '11:45:00', 1.4, 0, 0, NULL, '', '', NULL),
(3, 'QUIEREN COLGAR LA TV DEL SALÓN', '2024-10-15', '2024-10-15', '3', 34, 'Piso 374', 'QUIEREN COLGAR LA TV DEL SALÓN', NULL, 0, 84.95, 21, 102.7895, 3, 1, 1, 'Se instala soporte pared en el salón y se coloca el TV.', '13:32:00', '14:29:00', 0.95, 0, 0, NULL, '', '', NULL),
(5, 'NO HAY LUZ EN UNA ZONA DE LA COCHERA CERCANA AL PORTAL 7', '2024-10-15', '2024-10-15', '3', 25, 'Cochera', 'NO HAY LUZ EN UNA ZONA DE LA COCHERA CERCANA AL PORTAL 7', NULL, 0, 51.68, 21, 62.5328, 5, 1, 1, 'Se comprueba el registro de alimentación de las iluminarías que está en la zona afectada de la cochera se llega a la conclusión que lo que falla son los tubos de la iluminaría', '10:43:00', '12:03:00', 1.33, 0, 0, NULL, '', '', NULL),
(6, 'El coche plaza 86 se mancha de óxido de tubería', '2024-10-15', '2024-10-15', '3', 1, 'Cochera', 'El coche plaza 86 se mancha de óxido de tubería', NULL, 0, 12, 21, 14.52, 6, 1, 2, 'Se instala una garrafa pequeña abierta debajo del codo de la tubería de hierro con un tubito para desviar la gota al lado de la columna.', '12:24:00', '13:00:00', 0.6, 0, 0, NULL, '', '', NULL),
(7, 'Atasco en arqueta jardín P-7 P-8 (Patio)', '2024-10-17', '2024-10-17', '3', 1, 'Patio', 'Atasco en arqueta jardín P-7 P-8 (Patio)', NULL, 0, 80, 10, 88, 7, 3, 2, 'Se hace desatasco del bajante situado\r\nen la cochera y que es el que evacua el agua de esta arqueta.\r\nSe realiza una inspección con cámara para ver que está limpio.\r\nSe tapa los 2 agujeros que se han hecho en el PVC del bajante para poder hacer las tareas de desatasco y\r\nla posterior inspección y verificación con la cámara.7', '12:43:00', '15:00:00', 2.28, 0, 0, NULL, '', '', NULL),
(8, 'Cerradura de la azotea rota', '2024-10-17', '2024-10-17', '3', 1, 'Azotea', 'Cerradura de la azotea rota', NULL, 0, 48.45, 21, 58.6245, 8, 1, 2, 'Perlas 2 P-10 --- Se sustituye la cerradura rota de la puerta de la azotea por una cerradura nueva de las mismas características. Se hace una adaptación necesaria sobre la puerta para poder instalar la cerradura nueva. Se reparte las llaves entre los vecinos. 1 llave por vecino. 12 en total.', '09:58:00', '11:41:00', 1.72, 0, 0, NULL, '', '', NULL),
(39, 'LA PUERTA AUTOMÁTICA DE SALIDA NO ABRE', '2024-10-17', '2024-10-17', '3', 37, '202', 'LA PUERTA AUTOMÁTICA DE SALIDA NO ABRE', NULL, 0, 30, 21, 36.3, 39, 1, 1, 'Se hace revisión de la puerta\r\nautomática batiente de salida de la cochera. En un principio no presenta fallo. Pero insistiendo en las\r\nmaniobras observamos que ha fallado la cerradura eléctrica CiSA. Se desmonta la misma y se hace\r\nreparación quedado en funcionamiento puerta. Pero debido al desgaste que ya presenta los mecanismos\r\ninternos de la propia cerradura y a que el resbalón está semipartido es conveniente sustituir la cerradura\r\neléctrica CISA por una nueva lo antes posible.', '15:02:00', '15:48:00', 0.77, 0, 0, NULL, '', '', NULL),
(40, 'ESTA CAYENDO AGUA A LA PLAZA 6 DE LACOCHERA', '2024-10-19', '2024-10-19', '3', 7, 'COCHERA', 'ESTA CAYENDO AGUA A LA PLAZA 6 DE LA\r\nCOCHERA', NULL, 0, 80, 21, 96.8, 40, 1, 1, 'Está cayendo agua a la cochera 6\r\ndesde hace varios dias y parece que es de acometida de agua general de la línea de los pisos 3 y 1°4...el vecino del 1°4 se llama Carlos. A través del techo desmontable del cuarto baño de piso 1°4 se inspecciona con cámara de inspección a través de la falsa columna.Y se localiza la zona aproximada donde se aprecia el agua para que el albañil cuando venga a romper sea lo menos posible para poder hacer la reparación\r\nEn el hueco de la falsa columna además de la tubería de acometida de agua, también está el bajante general de los baños y el desagüe de las máquinas de aire acondicionado.', '09:02:00', '10:00:00', 0.97, 0, 0, NULL, '', '', NULL),
(41, 'Patio.- Hay que cambiar todos los números deidentificación de los portales 1 al 7', '2024-10-19', '2024-10-19', '3', 25, 'PORTALES', 'Hay que cambiar todos los números de\r\nidentificación de los portales 1 al 7', NULL, 0, 188.87, 21, 228.5327, 41, 1, 1, 'Se ponen números identificativos de los\r\nportales nuevos en acero inoxidable . Y se retiran los viejos. Se limpian la zona de fachada de los retos de\r\nSilicona una vez quitados los números viejos y se fijan los nuevos', '13:10:00', '14:41:00', 1.52, 0, 0, NULL, '', '', NULL),
(42, 'BOMBILLA FUNDIDA 3° PLANTA', '2024-10-18', '2024-10-18', '3', 1, 'PORTAL 10', 'BOMBILLA FUNDIDA 3° PLANTA', NULL, 0, 8.98, 21, 10.8658, 42, 1, 2, 'Se sustituye la bombilla LED fundida en\r\nel plafón del rellano de la 3° planta por nueva bombilla led 7w 5000k', '13:32:00', '13:41:00', 0.15, 0, 0, NULL, '', '', NULL),
(43, 'RECOGER MOTOR DEL SAT E INSTALAR PTA AUT COCHERA', '2024-10-21', '2024-10-21', '3', 26, 'COCHERA', '241027 - Miguel Marcado', NULL, 0, 72.5, 21, 87.725, 43, 1, 1, 'Se recoge el motor hidráulico en el SAT.\r\nPara su translado a la cochera y su colocación en la puerta automática basculante.', '09:11:00', '09:35:00', 1, 0, 0, NULL, '', '', NULL),
(45, 'APLICACIÓN PARA SEBASTIÁN Problemas datos del nuevo proveedor...Falta teléfono y además que hay demasiados campos obligatorios...No se que le parece a Miguel Ángel, pero yo dejaría obligatorio solo CIF y NOMBRE', '2024-10-21', '2024-10-21', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 65, 10, 71.5, 45, 6, 2, 'Se han añadido funcionalidades de atajos para añadir proveedores de manera rápida mientras se ficha una compra', '10:00:00', '11:30:00', 1.5, 0, 0, 'Sebastian', 'ESTE', '', NULL),
(46, 'APLICACIÓN Añadir campos expansibles en partes de trabajo', '2024-10-21', '2024-10-21', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 65, 10, 71.5, 46, 6, 2, 'Se implementan campos expansibles en el módulo de partes de trabajo, ya que había que deslizar y era incómodo leer los datos de los campos solución y observaciones, además se incluye el bloqueo de la firma para que no interfiera con el desplazamiento de la pantalla, se añade el evento doble click', '11:30:00', '13:00:00', 1.5, 0, 0, 'Sebastián Rosero', '16112024', '', NULL),
(48, 'Proyecto-INSTALAR EL MOTOR QUE YA ESTA REPARADO PTA AUT ENTRADA', '2024-10-21', '2024-10-21', '3', 26, 'COCHERAS', '241027 - Miguel Marcado', NULL, 0, 55, 21, 66.55, 48, 1, 1, 'Instalación del motor hidráulico ya reparado en puerta automática basculante de entrada cochera.\r\nSe ajusta el contrapesado de la columna derecha (vista desde dentro) y la puerta queda abierta hasta 2,25 MTS de altura.\r\nSe realiza distintas maniobras de apertura y cierre de la puerta y se comprueba que en todo momento el funcionamiento del motor es el correcto.', '12:30:00', '14:20:00', 2, 0, 0, NULL, '', '', NULL),
(49, 'TELEFONILLO PORTERO AUT. PISO 4-2', '2024-10-19', '2024-10-19', '3', 39, 'Piso 2•2 4•2', 'TELEFONILLO PORTERO AUT. PISO 4-2', NULL, 0, 41.13, 21, 49.7673, 49, 1, 1, 'No se escucha en el telefonillo del\r\npropio piso, telefonillo que tiene es un tegui universal antiguo. Se sustituye por un telefonillo nuevo tegui\r\nuniversal.\r\nSe comprueba antes desde la placa con otro telefonillos para verificar que el fallo es del propio telefonillo.', '10:35:00', '11:35:00', 1, 0, 0, NULL, '', '', NULL),
(50, 'TELEFONILLO PORTERO AUT. PISO 2-2', '2024-10-19', '2024-10-19', '3', 39, 'Piso 2-2', 'TELEFONILLO PORTERO AUT. PISO 2-2', NULL, 0, 41.13, 21, 49.7673, 50, 1, 1, 'Telefonillo antiguo FERMAX, no se escucha nada. Se sustituye por un telefonillo nuevo tegui universal. Se comprueba antes desde la placa con otro telefonillos para verificar que el fallo es del propio telefonillo.', '10:35:00', '11:35:00', 1, 0, 0, NULL, '', '', NULL),
(51, 'Abrepuertas totalmente destrozado', '2024-10-19', '2024-10-19', '3', 6, 'PORTAL 6', 'brepuertas totalmente destrozado', NULL, 0, 24.25, 21, 29.3425, 51, 1, 2, 'Se pone Abrepuertas nuevo DORCAS.', '11:45:00', '12:05:00', 0.33, 0, 0, NULL, '', '', NULL),
(52, 'APLICACIÓN MODIFICAR MENU.', '2024-10-22', '2024-10-22', '3', 11, 'Informática', '241027 - Miguel Marcado', NULL, 0, 170, 10, 187, 52, 1, 2, 'Se realizan cambios solicitados', '12:30:00', '17:00:00', 4.5, 0, 0, NULL, '16112024', '', NULL),
(53, 'APLICACIÓN ... En pantalla de partes de trabajo A hacer doble click en los campos que queremos leer completos no conseguimos leer todo el texto ... Ver video..', '2024-10-22', '2024-10-22', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 155, 10, 170.5, 53, 1, 2, 'Se soluciona los campos auto expansibles', '09:30:00', '12:30:00', 3, 0, 0, NULL, '', '', NULL),
(54, 'Este campo Asunto hacerlo que sea Campo de texto autoextensible en Citas y Órdenes y Partes. ( Creo que en partes de trabajo ya está hecho .\r\nSe tiene que ver el texto entero\r\nSe tiene que ver el texto entero\r\nE\r\nN\r\nT\r\nE\r\nR\r\nO', '2024-10-23', '2024-10-23', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 105, 10, 115.5, 54, 1, 2, 'Se modifican los campos asunto en citas, órdenes y parte para visualizar el contenido completo de los campos', '10:00:00', '15:30:00', 5.5, 0, 0, 'SEBASTIÁN ROSERO LOPEZ', '', '', NULL),
(55, 'MIRASIERRA 16. ESTA CAYENDO AGUA PLAZA 6', '2024-10-23', '2024-10-23', '3', 6, 'PORTAL 16', 'ESTE PARTE NO SE AÑADIDO AL PROYECTO PORQUE YA SE HA HECHO FACTURA APARTE', NULL, 0, 181.51, 21, 219.6271, 55, 3, 1, 'Hay una perdida de agua en la acometida general de agua piso 1°4 Linea de los pisos 3 .Se rompe en la falsa columna del cuarto de baño del fondo del pasillo en el sitio donde está la perdida de agua en la tubería de la acometida general. Se coloca tapaporos  GEBO y se tapa la Apertura con rasillas hasta que el albañil coloque los azulejos los más parecidos a los existentes.\r\n.Queda pendiente la colocación de los azulejos por parte del albañil.', '09:00:00', '13:21:00', 4.35, 0, 0, NULL, '', '', NULL),
(56, 'Técnico 2 ya está haciendo los partes de trabajo por la aplicación y esta mañana hemos tenido que ir por segunda vez al mismo trabajo con lo cual cuando termine el parte de trabajo de esta mañana tendrá que hacer su primer proyecto... \r\n\r\nY en esta pantalla se hace necesario que muestre la columna proyectos para poder filtrar y ver que están todas las tareas debidamente registradas.', '2024-10-23', '2024-10-23', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 145, 10, 159.5, 56, 6, 2, 'Se agrega nueva columna junto a nueva funcionalidad de proyectos en el módulo de partes de trabajo, junto con todo el flujo', '19:00:00', '21:00:00', 2, 0, 0, 'Sebastián rosero', '16112024', '', NULL),
(57, '1° De La pantalla \"detalles del proyecto\" ver cómo se puede poner para que la orden y el parte lleven el mismo número.\r\n\r\n2° En pantalla \"detalles del proyecto\" hace falta botones PDF y ZIP.', '2024-10-24', '2024-10-24', '3', 11, 'Informatica', '241027 - Miguel Marcado', NULL, 0, 89.67, 21, 108.5007, 57, 6, 2, 'Se agregan botones de descargar zip al ver el detalle del proyecto y se ajusta base de datos para que el número de parte coincida con el número de orden', '12:30:00', '21:28:00', 8.97, 0, 0, 'Sebastian', '', '', 'Agregar Zip a los partes de trabajo'),
(58, '1° En pantalla órdenes falta el título.\r\n2° Falta evento doble click y que edite la \r\n    cita.', '2024-10-24', '2024-11-09', '2', 11, 'Informática', NULL, NULL, 0, 20, 10, 22, 58, 1, 1, 'Se añaden evento de doble click y se añaden titulos correspondientes a cada pantalla', '14:02:00', '15:02:00', 1, 0, 0, NULL, NULL, NULL, NULL),
(59, 'Estos botones nuevos para que sirven?...se lesmpiede pineros nombre o por lo menos los títulos emergentes?', '2024-10-24', '2024-11-09', '2', 11, 'Informática', NULL, NULL, 0, 10, 10, 11, 59, 6, 1, 'Se añaden nombres y aclaraciones sobre cada uno de los botones de partes de trabajo', '14:02:00', '15:02:00', 1, 0, 0, NULL, NULL, NULL, NULL),
(60, 'PROBLEMAS ILUMINACIÓN RELLANO SUBIDA PORTAL A 1°PLANTA.', '2024-10-23', '2024-10-23', '3', 41, 'Portal', NULL, NULL, 0, 52.81, 21, 63.9001, 60, 2, 1, 'Se sustituye la luminaria de la subida a primera planta que está rota por una nueva un poquito más pequeña, pero que da más luz. La que había era una regleta de 1 tubo de 60cm y se coloca una tipo regleta pero más pequeña y que da más luz, panel LED de 18w.', '13:34:00', '14:40:00', 1.1, 0, 0, NULL, '', '', NULL),
(61, 'PROBLEMAS PORTERILLOS CON 3°3 - RAQUEL.', '2024-10-23', '2024-10-23', '3', 41, 'Portal', NULL, NULL, 0, 89.74000000000001, 21, 108.5854, 61, 1, 1, 'La vecina del piso 3°3 Raquel no le suena la llamada en los 2 telefonillos que tiene en su piso.\r\nProblemas con el grupo de pulsadores\r\nSe cambia el grupo de pulsadores 3-1 , 3-2 , 3-3, 3-4 y se queda solucionada la avería. Observamos que la etiqueta 4-4 no se ve y se le pone etiqueta nueva piso 4°4. Se queda la placa de portero automático TEGUI funcionando.', '14:40:00', '16:10:00', 1.5, 0, 0, NULL, '', '', NULL),
(63, 'PROYECTOS CON SU NÚMERO CORRESPONDIENTE EN LA ETIQUETA.... ya que como nos dedicamos a trabajos muy similares en en distintos sitios pero muy semejantes el nombre de los proyectos muchas veces va a coincidir y sería necesario que aparezca el número para no confundirlos.', '2024-10-24', '2024-11-06', '2', 11, 'Informatica', NULL, NULL, 0, 25, 21, 30.25, 63, 6, 2, 'Se soluciona doble click', '14:02:00', '15:02:00', 1, 0, 0, NULL, '', '', NULL),
(64, 'Añadir campo número teléfono en proveedor', '2024-10-24', '2024-10-24', '2', 11, 'Informatica', NULL, NULL, 0, 10, 10, 11, 64, 1, 2, 'Se añade funcionalidad requerida', '12:30:00', '14:30:00', 2, 0, 0, NULL, NULL, NULL, NULL),
(65, 'Quemadas- REVISIÓN ALUMBRADO PUBLICO EN TODAS CALLES. - la presidenta dice que hay una farola fundida en C/10.', '2024-10-25', '2024-10-25', '3', 19, 'LAS QUEMADAS', NULL, NULL, 0, 126.64, 21, 153.2344, 65, 2, 1, 'Se hace revisión del alumbrado calles zona pozo de arriba y se sustituyen bombillas LEDS fundidas en farola calle la cuesta frente casa 38 y en farola esquina calle 10 con calle La Gravera.\r\nTambién se hace revisión del alumbrado de las calles del pozo de abajo. Y no se encuentra ninguna farola.\r\nSe ajusta el encendido y apagado en el reloj programador del cto de las farolas del pozo de abajo:\r\nEncendido a las 19:30 h\r\nApagado a las 08:15 h', '11:30:00', '13:28:00', 1.97, 0, 0, NULL, '', '', NULL),
(66, 'Islas.- Limpiar terracitas cortadas situadas en lo alto de los cuartitos de mantenimiento.', '2024-10-25', '2024-10-25', '3', 9, 'PATIO', NULL, NULL, 0, 0, 21, 0, 66, 1, 1, 'LIMPIEZA DE AZOTEAS SITUADAS EN LO ALTO DE LOS CUARTITOS DE MANTENIMIENTO.', '10:09:00', '10:40:00', 0.52, 0, 0, NULL, '', '', NULL),
(67, 'LA APLICACIÓN HACE COSAS EXTRAÑAS. Después de subir 5 fotos en parte de trabajo después de guardarlo sólo muestra 2 . Parte 55', '2024-10-26', '2024-10-26', '2', 11, 'Informática', NULL, NULL, 0, 10, 10, 11, 67, 1, 1, 'Se solucionan errores de consistencia de datos de la aplicación', '14:02:00', '15:02:00', 1, 0, 0, NULL, NULL, NULL, NULL),
(68, 'El presidente comenta que hay que montar la farola que se desmontó para la poda del árbol.', '2024-10-25', '2024-10-25', '3', 1, 'PATIO', NULL, NULL, 0, 5, 21, 6.05, 68, 1, 1, 'Se instala la farola que hubo que desmontar en el patio para el corte del pino. Se hace la fijación a la base de la misma y se realizan las conexiones eléctricas. Se comprueba que enciende de forma correcta cuando se activa el cto de 1/2 noche que es al que pertenece la misma', '13:40:00', '14:39:00', 0.98, 0, 0, NULL, '', '', NULL),
(69, 'Proyecto-Se requiere un indicativo que muestre cuando los archivos se están subiendo.', '2024-10-26', '2024-10-26', '2', 11, 'Informatico', 'Orden de trabajo generada a partir de la parte de trabajo: Técnico 2 ya está haciendo los partes de trabajo por la aplicación y esta mañana hemos tenido que ir por segunda vez al mismo trabajo con lo cual cuando termine el parte de trabajo de esta mañana tendrá que hacer su primer proyecto... \r\n\r\nY en esta pantalla se hace necesario que muestre la columna proyectos para poder filtrar y ver que están todas las tareas debidamente registradas.', NULL, 0, 10, 10, 11, 69, 6, 2, 'se añade preLoader y carga instantanea de archivos como imagenes o videos en especial cuando pesan en exceso', '16:12:00', '17:02:00', 0.83, 0, 0, 'SEBASTIAN ROSERO LOPEZ', NULL, NULL, NULL),
(70, 'QUEMADAS.- C8.Hay que reparar la farola doblada de la calle 8 y reponerle los cristales...aviso dado por la presidenta.', '2024-10-27', '2024-10-31', '3', 19, 'LAS QUEMADAS', NULL, NULL, 0, 129.78, 21, 157.0338, 70, 2, 1, 'Se realiza la reparación de la farola.\r\nSe hace reparación del farol colocando los 4 cristales nuevos. ( Se usa paneles de polietileno transparente) y reparando el equipo. La reparación se realiza en taller. Una vez reparado se hace la instalación del farol y la conexión y comprobación. Se coloca una bombilla LED nueva E-27 de 30w', '09:02:00', '10:34:00', 1.53, 0, 0, NULL, '', '', NULL),
(71, 'Implementar histórico de artículos desde modulo de partes de trabajo', '2024-10-28', '2024-10-28', '2', 11, 'INFORMATICA', NULL, NULL, 0, 30, 10, 33, 71, 6, 2, 'Se implementa histórico desde partes de trabajo', '14:02:00', '17:02:00', 3, 0, 0, 'SEBASTIAN ROSERO LOPEZ', NULL, NULL, NULL),
(72, 'Hola Tatiana... Como ves en el vídeo se va llenando de partes de trabajo con la misma categoría de \"finalizado\" y sería de gran ayuda el poder mostrar en el mismo listado 4 checkbox que aparezcan chequeados por defecto ...con las categorías de \"pendiente\" ,\"en proceso\", \"finalizado\" y \"facturado\"...\r\n\r\nRecordar que para el estado de \"facturado\" es porque ya el parte se ha metido en una factura en ventas y se ha entregado al cliente ... con lo cual ya no debe de permitir el que se modifique ningún elemento de la factura bajo ninguna circunstancia...\r\n\r\n Tan solo podría hacer algún cambio el administrador principal y en casos muy excepcionales.', '2024-10-28', '2024-11-09', '2', 11, 'Informática', NULL, NULL, 0, 10, 10, 11, 72, 1, 1, 'Se añade filtrador especifico para solucionar esta problematica mantieniendo pulsado sobra la columna la cual se requiere filtrar', '14:02:00', '19:35:00', 5.55, 0, 0, NULL, NULL, NULL, NULL),
(73, 'REVISIÓN LUCES COCHERA A.B.C.', '2024-10-28', '2024-10-28', '3', 6, 'COCHERA ABC', NULL, NULL, 0, 63.129999999999995, 21, 76.3873, 73, 1, 2, 'Se hace revisión luces de la cochera y se sustituye 4 tubos fundidos largos por 4 tubos LEDS nuevos y 1 tubo corto de 60cm por un tubo LED nuevo en la salida hacia subida escaleras del portal 14.', '13:02:00', '14:06:00', 1.07, 0, 0, NULL, '', '', NULL),
(74, 'La Vereda.P2.- Hay un escape de agua en la escalera 2. Hay informar al presidente de todo lo que se haga.\r\n\r\n625018873 ... Javier presidente.', '2024-10-29', '2024-10-29', '3', 31, 'ESCALERA 2', NULL, NULL, 0, 65, 21, 78.65, 74, 1, 1, 'Los vecinos tuvieron anoche que apagar los grupos de presión y cortar el agua. Se estaba inundando la cochera. Una de las bombas tienen el cuerpo de acero inoxidable rajado .\r\nSe desmonta la bomba n°1 que es la que tiene el cuerpo rajado para llevar al SAT para su reparación.\r\nSe retira y se lleva al SAT.\r\n En su lugar se coloca la bomba n°3 ( bomba de reserva retirada del SAT que está recién reparada para poder  realizar está operación).\r\nSe comprueba los equipos de control y las 2 bombas una vez puestas en funcionamiento.\r\nNota : Se detecta que la bomba recién instalada (la queda como n°1) hace un ruido como de rozamiento a arrancar y parar. Pero queda instalada funcionando.', '08:00:00', '10:10:00', 2.17, 0, 0, NULL, '', '', NULL),
(75, 'MIRASIERRA JARDINES.- hacer revisión alumbrado jardines.', '2024-10-28', '2024-10-28', '3', 6, 'JARDINES', NULL, NULL, 0, 19.82, 21, 23.98, 75, 1, 2, 'Se hace revisión de las luces de los jardines y se sustituyen 3 bombillas LEDS en ojos de buey. También se repara la base de una farola en la zona del chiringuito.', '14:18:00', '15:23:00', 1.08, 0, 0, NULL, '', '', NULL),
