(78, 'Mirasierra 2 - Azotea no le funciona el alumbrado.', '2024-10-28', '2024-10-28', '3', 6, 'PORTAL 2', NULL, NULL, 0, 9.94, 21, 12.02, 78, 1, 2, 'En la azotea donde se tiende la ropa no enciende la luz. En lo alto de la puerta de acceso a la azotea hay 2 puntos de luz y ninguno enciende. Uno de ellos es un ojo de buey con la bombilla fundida y el otro es un proyector de luz ya antiguo con lampara halógena lineal de yodo. Este tipo de lámparas ya no se utiliza. Ya todo se utiliza el LED. Sustituimos la bombilla fundida del ojo del buey por una bombilla LED nueva y el proyector queda pendiente de consultar con la presidenta la sustitución del proyector completo por un proyector LED', '15:25:00', '15:45:00', 0.33, 0, 0, NULL, '', '', NULL),
