(102, 'Todos los portales. Revisión grupos de Presión.', '2024-10-08', '2024-10-08', '3', 31, 'P-1 P-2 P-3 P-4', NULL, NULL, 0, 55, 21, 66.55, 102, 1, 1, 'Revisión grupos de Presion en todos los portales.', '14:00:00', '16:00:00', 2, 0, 0, NULL, '', '', NULL),
(103, 'LA VEREDA P-3 . BOMBA 2.\r\nGrupo de presión una de las bombas estan soltando agua', '2024-01-04', '2024-01-05', '3', 31, 'Portal 3', NULL, NULL, 0, 55, 21, 66.55, 103, 1, 1, 'La VEREDA P-3. Día 5.01.\r\n- Como está\r\nbomba está en garantía del fabricante , se desmonta y se lleva al SAT de la.marca en Córdoba\r\n(HIDROELEC) Siguiendo instrucciones precisas del mismo SAT.Se le adjunta la documentacion que\r\nsolicita al SAT. Se le recuerda al administrador la necesidad de mantenimiento técnico de estos sistemas ,\r\nesto ya se le ha indicado muchas veces de forma verbal, por mensajería y través de documentación que se\r\nle presento cuando se hizo la sustitucion. También se le recuerda que la anterior bomba que íbamos a\r\nutilizar como repuesto sigue estando rota y que sería necesario repararla cuanto antes para utilizarla en\r\nestas ocasiones.', '14:05:00', '15:09:00', 1.23, 0, 0, NULL, '', '', NULL),
(104, 'Grupos de presión de agua. Hay que\r\nrevisarlos todos y ver cómo están. Portal 1 hay problemas.', '2024-01-15', '2024-01-15', '3', 31, 'Portal 1', NULL, NULL, 0, 55, 21, 66.55, 104, 1, 1, 'Se realiza una revisión de los grupos de\r\npresión de cada uno de los 4 portales. Y se revisan las configuración de cada uno de ellos. El grupo del\r\nportal 3 sigue funcionando con una sola bomba , pues la otra está en el SAT reparando. En el portal 1 se\r\nobserva una mala gestión de lo equipos electrónicos, posiblemente por algún error de programación. Se\r\nreinicia todo el sistema y se comprueba ya su correcto funcionamiento. Una de las bombas estan\r\nproduciendo ruido se retira para reparación en SAT.', '13:01:00', '14:22:00', 1.35, 0, 0, NULL, NULL, '', NULL),
(105, 'LA VEREDA P-3. INSTALAR BOMBA GRUPO', '2024-01-23', '2024-01-23', '3', 31, 'Portal 3', NULL, NULL, 0, 55, 21, 66.55, 105, 1, 1, '. Se recoge del SAT y se\r\nvuelve a montar la bomba en el grupo presion escalera 3 que ya está reparada.\r\nReposicion de juntas estanqueidad y calibracion presiones.\r\nAjuste y comprobación de los equipos electrónicos.', '10:30:00', '12:15:00', 1.75, 0, 0, NULL, '', '', NULL),
(106, 'Bomba grupo de presión montar la\r\nreparada', '2024-01-23', '2024-01-23', '3', 31, 'Portal 1', NULL, NULL, 0, 55, 21, 66.55, 106, 1, 1, 'Se instala la bomba reparada en el SAT y se comprueba el correcto funcionamiento revisando los equipos electrónicos', '12:15:00', '14:10:00', 1.92, 0, 0, NULL, '', '', NULL),
(107, 'ESCAL.1- GRUPO PRESION-BOMBA 1 CON MUCHO RUIDO -', '2024-08-14', '2024-08-14', '3', 31, 'PORTAL 1', NULL, NULL, 0, 55, 21, 66.55, 107, 1, 1, 'Bomba 1. Se recoge bomba reparada\r\nen HIDROELEC y se instala. Pero hace salta el diferencial y nos vemos obligados a volver a instalar la\r\nbomba averiada que hace mucho ruido. Y devolver a HIDROELEC la que habíamos recogido\r\nsupuestamente reparada.', '13:02:00', '15:01:00', 1.98, 0, 0, NULL, '', '', NULL),
