(110, 'Grupo de presión. Una de las bombas del grupo de presión hace mucho ruido', '2024-02-02', '2024-02-02', '3', 31, 'Portal', NULL, NULL, 0, 55, 21, 66.55, 110, 1, 1, 'La segunda bomba del grupo de\r\npresión no alcanza la presión necesaria y hace ruido.\r\nSe retira la misma para su traslado al SAT para su reparación y en su lugar se instala la que había de\r\nreserva que ya estaba reparada', '11:00:00', '13:00:00', 2, 0, 0, NULL, '', '', NULL),
(111, 'Proyecto-Se quiere anexar nueva función en el módulo de proyecto un botón de crear nuevo proyecto y dicho botón dejé seleccionar las partes de trabajo que se requieran y las arrastre hasta ese nuevo proyecto.   - por otra parte se requiere un nuevo campo de notas 1 en la tarjeta de editar parte de trabajo con la funcionalidad de poder colocar una marca de filtro.', '2024-11-04', '2024-12-11', '2', 11, 'Informática', 'Orden de trabajo generada a partir de la parte de trabajo: Proyecto-Se requiere módulo de presupuestos', NULL, 0, 110, 10, 121, 111, 6, 2, 'Se realiza nueva mejora en el módulo de proyectos para crear proyecto y anexar las órdenes/partes necesarios con las acciones de ver la orden/parte y eliminarlo del proyecto', '09:00:00', '20:00:00', 11, 0, 0, 'Sebastián Rosero', NULL, NULL, NULL),
(112, 'BARRERA DETEC.PRESENCIA PTA.ABATIBLE SALIDA INSTALACIÓN', '2024-11-05', '2024-11-05', '3', 45, 'COCHERA', NULL, NULL, 0, 137.82, 21, 166.7622, 112, 1, 1, 'Se quitar la actual Fotocélula infrarroja reflectante de espejo de la puerta automática basculante de salida y que está dando problemas y en su lugar se coloca una pareja de fotocélula emisor - receptor con la instalación del cable bajo tubo PVC en la parte exterior para el emisor y se aprovecha la instalación ya existente para el receptor', '11:40:00', '13:29:00', 1.82, 0, 0, NULL, '', '', NULL),
(113, 'Mirasierra 2 Bajada a cocheras hay un plafón que no enciende', '2024-11-05', '2024-11-05', '3', 6, 'PORTAL 2', NULL, NULL, 0, 14, 21, 16.94, 113, 1, 2, 'Mirasierra 2 Bajada a cocheras hay un plafón que no enciende... Aviso dado por Belén la vocal de portal.\r\nSe sustituye la bombilla fundida del plafón por una bombilla LED nueva E-27 7w 5000k.\r\nSe observa también que el plafón de lo alto del ascensor ( acceso ascensor a cochera ) tampoco enciende. Bueno a los pocos segundos enciende pero la luz es muy tenue.\r\nSe sustituye la bombilla LED fundida por una bombilla LED nueva E-27 7w 5000 k\r\nEn total son 2 bombillas LEDS', '15:55:00', '16:38:00', 0.72, 0, 0, NULL, '241121-Miguel-revisar', '', NULL),
(114, 'PERIODISTA COCHERAS. FOSOS. Revisión y limpieza.', '2024-11-05', '2024-11-05', '3', 45, 'COCHERA', NULL, NULL, 0, 55, 21, 66.55, 114, 1, 1, 'Se hace revisión y limpieza de los 2 fosos de la cochera. Y se comprueban las 2 bombas de achique.', '09:30:00', '10:39:00', 1.15, 0, 0, NULL, '', '', NULL),
(115, 'PERIODISTA PATIO. REVISIÓN Y LIMPIEZA DE CANALONES -- CUBIERTA ZONA PORCHES LOCALES', '2024-11-05', '2024-11-05', '3', 45, 'PATIO', NULL, NULL, 0, 55, 21, 66.55, 115, 1, 1, 'Se hace la limpieza de los canalones, así como la cubierta y terracita de los altos de los porches donde están los locales.', '08:30:00', '09:26:00', 0.93, 0, 0, NULL, '', '', NULL),
(116, 'PERIODISTA PATIO. REVISIÓN LUCES', '2024-11-05', '2024-11-05', '3', 45, 'PATIO', NULL, NULL, 0, 139.76999999999998, 21, 169.1217, 116, 1, 1, 'Se hace revisión de luces del patio y se sustituyen :\r\n2 bombillas LEDS apliques porche P-22\r\n1 bombilla LED aplique porche P-18 / P-20\r\n1 bombilla LED porche P-14\r\n1 bombilla LED porche zona de los locales.\r\nEn total 5 bombillas LEDS E-27 7w 5000k\r\nTambién se sustituye 1 bombilla LED de 30w en la farola más próxima al P-14', '08:20:00', '10:49:00', 2.48, 0, 0, NULL, NULL, '', NULL),
(117, 'PERIODISTA 14. NO ENCIENDE LUZ 5° PLANTA', '2024-11-05', '2024-11-06', '3', 47, 'P-14', NULL, NULL, 0, 45.99, 21, 55.6479, 117, 1, 1, 'En el rellano de la 5° planta hay una de las bombillas R-90 que no enciende. Se sustituye la bombilla fundida por una bombilla LED nueva R-90.', '12:55:00', '13:29:00', 0.57, 0, 0, NULL, NULL, '', NULL),
(118, 'COCHERA PLAZA 4 PROYECTOR LED NO ENCIENDE', '2024-11-05', '2024-11-06', '3', 45, 'COCHERA', NULL, NULL, 0, 62.28, 21, 75.3588, 118, 1, 1, 'Se sustituye el proyector LED que no enciende por uno nuevo de 20w con detector de movimiento PIR. Se comprueba su correcto funcionamiento una vez instalado.', '13:20:00', '14:10:00', 0.83, 0, 0, NULL, NULL, '', NULL),
(119, 'Las Islas.- Ismael , el presidente, dice que la PTA aut. 2 se queda abierta.', '2024-11-06', '2024-11-06', '3', 9, 'COCHERA', NULL, NULL, 0, 48.98, 21, 59.2658, 119, 1, 1, 'La cerradura eléctrica de la puerta automática batiente n°2 de entrada cochera no apestilla. La bobina interna se queda agarrotada y deja la cerradura abierta. Se repara la cerradura sustituyendo la bobina CISA de la cerradura por una nueva. Se comprueba el correcto funcionamiento una realizada la reparación.', '10:30:00', '11:44:00', 1.23, 0, 0, NULL, NULL, '', NULL),
(120, 'Perlas 2 P7 - 2 °C Ricardo. Cambiar monitor vídeoportero de sitio', '2024-11-06', '2024-11-11', '3', 59, 'Piso 2C', NULL, NULL, NULL, 55, 21, 66.55, 120, 1, 1, 'Se retira el monitor de Vídeoportero de su ubicación actual y se instala junto la puerta de entrada al piso. Se hace acometida desde la nueva posición y se conecta en registro rellano 2° planta. Se comprueba el correcto funcionamiento. También se hace la instalación de un timbre nuevo facilitado por Ricardo.', '08:49:00', '09:55:00', 1.1, 0, 0, NULL, NULL, NULL, NULL),
(122, 'Av. Virgen de Los Dolores 17 .Hay plafones de luces que no se apagan.', '2024-11-07', '2024-11-07', '3', 48, 'BLOQUE', NULL, NULL, 0, 105.47999999999999, 21, 127.6308, 122, 1, 1, 'Av. Virgen de Los Dolores 17 .\r\nHay plafones de luces que no se apagan y están siempre encendidos.Carmen comenta que los 2 de las 4° planta NO se apagan. Pero cree que hay otro más. Que se revisen.\r\nEn el Rellano 4° planta ... NO SE APAGA.\r\nJunto ascensor 4° planta NO SE APAGA.\r\nA los 2 se le sustituye el modulo de detección de movimiento por microondas por un modulo nuevo .\r\nSe ajusta  y se comprueban una vez instalados los módulos nuevos.\r\nSe revisan el resto de plafones.', '12:40:00', '14:06:00', 1.43, 0, 0, NULL, NULL, NULL, NULL),
(123, 'Mirasierra 2.- El admin.dice que Belén , la nueva vocal del portal 2 ,  necesita juego de llaves del portal por qué ella es ahora la vocal de su portal y no tiene ninguna llave de su portal para utilizarla en caso de emergencia.\r\n\r\n636133736 ... Belén.', '2024-11-07', '2024-11-07', '3', 6, 'PORTAL 2', NULL, NULL, 0, 12.05, 21, 14.5805, 123, 1, 1, 'Se le entrega a Belén piso 4°4 las siguientes copias de llaves.\r\n1 Portal \r\n1 Azotea\r\n1 Cto contadores luz\r\n1 Cto contadores agua y Limpieza \r\n1 PTA salida a jardín\r\n1 PTA acceso minusválidos', '09:37:00', '11:30:00', 1.88, 0, 0, NULL, '241121-Miguel-revisar', NULL, NULL),
(126, 'Quemadas C6.-Farola no enciende.', '2024-11-08', '2024-11-09', '3', 19, 'Calle 6', NULL, NULL, 0, 68.32, 21, 82.6672, 126, 1, 1, 'Al final de la calle 6 hay una farola que no enciende. Se sustituye la bombilla LED fundida por una bombilla LED nueva.\r\nSe hace revisión del resto de farolas en los 2° ctos y se ajusta el programador del pozo de abajo.', '09:07:00', '11:09:00', 2.03, 0, 0, NULL, NULL, NULL, NULL),
(127, 'Magallanes 8 piso 6-2\r\nNo escuchan el porterillo.', '2024-11-08', '2024-11-08', '3', 49, 'PORTAL', NULL, NULL, 0, 59.63, 21, 72.1523, 127, 1, 1, 'La avería es general le pasa a todos los vecinos. La placa de portero automático tiene el altavoz roto. Se sustituye el mismo por uno nuevo. Se comprueba el correcto funcionamiento de la placa de portero automático una vez realizada la reparación.\r\nNOTA: Todo el sistema de portero automático es muy antiguo ( TUNE ) de hace unos 40 años. Nos solicitan presupuesto', '12:50:00', '13:58:00', 1.13, 0, 0, NULL, NULL, NULL, NULL),
(128, 'LETMAR .- Recoger módulo grupo fónico GUINAZ...957-764630', '2024-12-08', '2024-11-08', '3', 46, 'Polígono los pedroches', NULL, NULL, 0, 0, 21, 0, 128, 1, 1, 'Se recoge módulo en polígono pedroches LETMAR', '13:00:00', '13:40:00', 0.67, 0, 0, NULL, '241111-Miguel-vender', NULL, NULL),
(129, 'PERIODISTA 20. INSTALAR GRUPO FONICO YA REPARADO PLACA PORT. AUT PORTAL.', '2024-11-08', '2024-11-08', '3', 46, 'PORTAL', NULL, NULL, 0, 242.5, 21, 293.425, 129, 1, 1, 'Se instala el grupo fónico ya reparado GUINAZ en la placa de portero automático del portal. Se hacen las adaptaciones , conexiones y ajustes necesarias necesarias para su puesta en funcionamiento.\r\nSe comprueba con distintos pisos el correcto funcionamiento.\r\nSe hace comprobación de', '13:50:00', '15:06:00', 1.27, 0, 0, NULL, '241111-Miguel-vender', NULL, NULL),
