(139, 'Vereda.- Retirada la bomba de Hidroelec hay que sustituirla por la que más ruido haga para que le hagan el torneado al eje...La admin ya está avisada.por este mensaje.', '2024-11-12', '2024-11-12', '3', 31, 'PORTAL 4', NULL, NULL, 0, 73.75, 21, 89.2375, 139, 1, 1, 'Se revisan todas las bombas de los 4 portales para determinar que bomba es la que ahora mismo presenta más ruido.\r\nObservamos que es la bomba n°1 ( la de la izquierda) del portal 4.\r\nSe sustituye la misma por la que llevamos reparada que se ha recogido de HIDROELEC.', '08:20:00', '10:53:00', 2.55, 0, 0, NULL, NULL, NULL, NULL),
(140, 'Perlas 2 P13 Baj.C.- Ramón dice que hace falta hacer una reparación en la instalación eléctrica de la lavadora ...en  la vivienda nueva de su hija.\r\n\r\n655873856 ... Ramon', '2024-11-12', '2024-11-13', '3', 53, 'COCINA', 'El trabajo se realiza en el piso de la hija de Ramón --- Jardines 4 P-11 1°A', NULL, 0, 59.73, 21, 72.2733, 140, 2, 1, 'Instalación de cable de tierra en los enchufes de la cocina que no lo tiene instalado. Uno de ellos es el de la lavadora.\r\nRevisamos los enchufes con el comprobador multifunción de instalaciones eléctricas y detectamos que los enchufes originales de la cocina SI tienen tierra , pero enchufes que han añadido después no le habían puesto el cable de tierra. 3 en total.\r\nUna vez instalado el cable de tierra y conectado. Hacemos comprobación enchufe lavadora y revisamos el Diferencial del cuadro eléctrico.\r\nUna vez realizadas las pruebas se observa que el diferencial está bien.\r\nSalta a 30,2mA y a los 8 msg\r\n\r\nNota: En el trabajo de sacar la lavadora de debajo de la encimera tirando de ella hacia fuera, se rompe la manguera de toma de agua a la altura del codo de entrada a la lavadora. \r\nLa manguera que se ha roto es de 1mts. Se coloca una nueva de 2 mts. Una vez terminados los trabajos y con la lavadora ya colocada en su sitio se comprueba la misma.', '11:33:00', '15:03:00', 3.5, 0, 0, NULL, NULL, NULL, NULL),
(142, 'Perlas 2 P11.- Hacer instalación de control de accesos para la puerta del portal.', '2024-11-12', '2024-11-12', '3', 1, 'PORTAL 11', NULL, NULL, 0, 191.24, 21, 231.4004, 142, 6, 1, 'Perlas 2 P-11 . Instalación de control de accesos para la puerta del portal.\r\n- Kit control de acceso de proximidad que incluye un lector de proximidad de perfil estrecho y reducidas dimensiones y un modulo de control mini.\r\nPermite gestionar hasta 1.000 usuarios.\r\nEn el módulo de control se quedan registradas las llaves Electrónicas de los vecinos de este portal según la base de datos que disponemos.\r\nNota : si algún vecino de este portal tiene una llave electrónica que no le abre. Debe de contactar con el personal de mantenimiento y se le deja registrada en el módulo de control.', '13:55:00', '15:24:00', 1.48, 0, 0, NULL, NULL, NULL, NULL);
