(144, 'Mirasierra 14.- La manilla-tirador de la puerta de acceso a jardines está arrancada de los remaches.\r\n\r\n 650413742 ... Javier Rebollo.', '2024-11-13', '2024-11-19', '3', 6, 'PORTAL 14', NULL, NULL, NULL, 23.91, 21, 28.9311, 144, 1, 2, 'La puerta de aluminio blanco de Salida jardines desde el portal tiene \r\nCerradura rota. Un junquillo de aluminio de uno de los cristales caído. El tirador arrancado y una bisagra partida.\r\nSe coloca pareja de Bisagras nuevas.\r\nSe fija con remaches el tirador que han arrancado.\r\nSe hace reparación de la cerradura.\r\nSe revisa el cierre de la puerta y se comprueba que el cierrapuertas no va bien y ha perdido golpe final en el cierre. Es necesario sustituir por un cierrapuertas nuevo.', '11:31:00', '15:44:00', 4.22, 0, 0, NULL, '241121-Miguel-revisar', NULL, NULL),
(145, 'Perlas 2 P09.-Hacer instalación de control de accesos para la puerta del portal.', '2024-11-15', '2024-12-06', '2', 1, 'PORTAL 9', NULL, NULL, NULL, 0, NULL, NULL, 145, 2, 1, 'Instalación de control de accesos para la puerta del portal.\r\n- Kit control de acceso de proximidad que incluye un lector de proximidad de perfil estrecho y reducidas dimensiones y un modulo de control mini.\r\nPermite gestionar hasta 1.000 usuarios.\r\nEn el módulo de control se quedan registradas las llaves Electrónicas de los vecinos de este portal según la base de datos que disponemos.\r\nNota : si algún vecino de este portal tiene una llave electrónica que no le abre. Debe de contactar con el personal de mantenimiento y se le deja registrada en el módulo de control.', NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL),
(146, 'Perlas 2 P10.- Hacer instalación de control de acceso electrónico del portal.', '2024-11-15', '2024-11-15', '2', 1, 'PORTAL 10', NULL, NULL, NULL, 0, NULL, NULL, 146, 2, 1, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, NULL),
(149, 'Mirasierra 8.- Detector presencia en cuarta planta no funciona.', '2024-11-18', '2024-11-18', '3', 6, 'PORTAL 8', NULL, NULL, NULL, 31.2, 21, 37.75, 149, 1, 2, 'El detector de movimiento radar de la planta del rellano de salida a la azotea está averiado.\r\nSe sustituye el detector de movimiento radar por uno nuevo del mismo modelo\r\nUna vez instalado el detector nuevo comprobamos que la bombilla del plafón está fundida y se sustituye por una bombilla LED nueva E-27 7w 5000k', '15:18:00', '16:11:00', 0.88, 0, 0, NULL, '241121-Miguel-revisar', NULL, NULL),
(152, 'Cita para sebastian, agregar campo descuento en partes de trabajo', '2024-11-18', '2024-11-26', '2', 11, 'Informática', NULL, NULL, 0, 25, 10, 27.5, 152, 1, 2, 'test', '14:02:00', '15:02:00', 1, 0, 0, NULL, NULL, NULL, NULL),
(153, 'Escañuela 8.-  revisión de alumbrado en caja de escalera.', '2024-11-10', '2024-11-11', '3', 55, 'Azotea', NULL, NULL, 0, 20, 21, 24.2, 153, 1, 1, 'Solución', '14:02:00', '15:02:00', 1, NULL, NULL, NULL, NULL, NULL, NULL),
(154, 'MIRASIERRA 14.La puerta de salida al jardín no llega a cerrar debido a que el cierrapuertas no va bien, es necesario la sustitución por nuevo ...Se informa a Javier , el vocal de portal , e indica que se sustituya por nuevo. Se informa también al admin.', '2024-11-18', '2024-11-18', '3', 6, 'PORTAL 14', NULL, NULL, NULL, 64.21000000000001, 21, 77.6941, 154, 1, 2, 'Se sustituye el cierrapuertas de la puerta de salida al jardín por uno nuevo', '14:27:00', '15:25:00', 0.97, 0, 0, NULL, '241121-Miguel-revisar', NULL, NULL),
(155, 'MIRASIERRA 14.\r\nNos comenta Javier (Vocal) 2°2 que hay un pulsador siempre roto en el portal.\r\nQue se sustituya el mismo por un mecanismo de tapa ciega.', '2024-11-19', '2024-11-19', '3', 6, 'PORTAL 14', NULL, NULL, NULL, 12.14, 21, 14.6894, 155, 1, 2, 'El pulsador de luz que está bajando la rampa del portal lo están rompiendo de forma continua. Este pulsador no tiene utilidad pues las luces encienden con detectores de movimiento. Se quita el pulsador roto y se coloca un mecanismo de tapa ciega blanca.', '15:30:00', '15:56:00', 0.43, 0, 0, NULL, '241121-Miguel-revisar', NULL, NULL),
(156, 'MIRASIERRA 14.\r\nNos comenta Javier (Vocal) 2°2 que hay un pulsador de luz roto en el acceso del ascensor a la cochera.\r\nQue se sustituya el mismo por un mecanismo de tapa ciega y se instale un detector de movimiento dentro del plafón para dar el servicio de luz a este rellano.', '2024-11-19', '2024-11-19', '3', 6, 'PORTAL 14', NULL, NULL, NULL, 30.24, 21, 36.5904, 156, 1, 2, 'El pulsador de luz del rellano de salida del ascensor a las cocheras está roto. Se sustituye el mismo por un mecanismo de tapa ciega y se instala un modulo detector de movimiento por microondas dentro del plafón del techo para que encienda la luz cuando detecte el movimiento.', '15:56:00', '16:40:00', 0.73, 0, 0, NULL, NULL, NULL, NULL),
(157, 'Periodista R.Mesa 7 Cocheras.- Pta.autom.C/.Gaceta no hace nada...Aviso dado por Pilar.', '2024-11-22', '2024-11-22', '3', 37, 'COCHERA', NULL, NULL, NULL, 55, 21, 66.55, 157, 1, 1, 'Puerta automática batiente de entrada. El vástago del motor hidráulico está suelto de la fijación a la puerta. Se sospecha que lo manipulan.\r\nSe sustituye la actual tuerca por 2 tuercas nuevas. Se pone polímero MS transparente a modo de lacre para saber si lo manipulan.', '11:51:00', '13:30:00', 1.65, 0, 0, NULL, NULL, NULL, NULL),
(158, 'Santa Marina 4 .- Revisión alumbrado comunidad y azotea.\r\n\r\n\r\n661029472     ... Teresa', '2024-11-22', '2024-11-26', '3', 58, 'Bloque', NULL, NULL, NULL, 97.3, 21, 117.733, 158, 1, 1, 'Trabajos varios:\r\nAzotea: Los cables de la antena están sueltos y se fijan con tacos y bridas.\r\nSe revisa que la antena colectiva está funcionando después de haber realizado el trabajo. Nota: Se observa que la cubierta de los cables esta deteriorada agrietada y con rajas.\r\nEs habitual que cuando los cables están en este estado cuando esté lloviendo se produzca deficiencia en la señal. Porque el agua entra a través de la camisa del cable y empapa toda la malla e incluso llegan hasta el propio vivo.\r\nBloque escalera: Las tapas de los registros de telecomunicaciones están todas en el suelo. Se fijan las tapas con tornillos en las tres plantas. \r\nPortal. Pulsador de la luz roto destrozado se sustituye por uno nuevo. \r\nPortal. Lámpara colgando del techo del portal no enciende se repara y se sustituye bombillas LED por nueva.', '08:04:00', '11:04:00', 3, 0, 0, NULL, NULL, NULL, NULL),
(159, 'Mirasierra 1.- Buenas tardes, me dicen que el pulsador para abrir la puerta del portal 1 no funciona, la persona de contacto es Carmelo García del 1-2', '2024-11-22', '2024-11-22', '3', 6, 'PORTAL 1', NULL, NULL, NULL, 10, 21, 12.1, 159, 1, 2, 'La puerta del portal no abre ni desde los telefonillos ni tampoco de pulsador del portal. Los contactos de suministro de electricidad al Abrepuertas están muy deteriorados . Se lijan los mismos y se consiguen que se quede funcionando.\r\nPero es necesario sustituir la pareja de contactos por unos nuevos .', '15:13:00', '16:12:00', 0.98, 0, 0, NULL, NULL, NULL, NULL),
(161, 'Perlas 2.P12.- Inmaculada quiere una llave de proximidad.\r\n\r\n646359380    ... Inmaculada.', '2024-11-19', '2024-11-22', '3', 1, 'Portal 12', NULL, NULL, NULL, 6.2, 21, 7.502, 161, 1, 1, 'Se le entrega llave electrónica', '11:15:00', '11:32:00', 0.28, 0, 0, NULL, NULL, NULL, NULL),
(162, 'Mirasierra 1.-Alumbrado entrada portal no enciende...Se ha informado a MªDolores (vocal 24) y ha Ca\r\nrmelo.', '2024-11-25', '2024-11-25', '3', 6, 'Portal 1', NULL, NULL, NULL, 53.32, 21, 64.5172, 162, 1, 2, 'De las 8 lamparas dicroicas que hay en el portal, todas ellas son halógenas de 50w solo enciende una. Se sospecha que hay avería. Pero se van ha sustituir todas ( las 8 )  por lámparas dicroicas LEDS nuevas de 7w. Se localizan averias en los cables del falso techo y se instala las 8 lámparas dicroicas nuevas con su portalámparas correspondiente también nuevas. Se retira del falso techo los transformadores antiguos de las lámparas retiradas. Una de las lámparas no enciende porque hay que hacerle la acometida de cables nueva. Queda pendiente de solucionarlo.', '14:01:00', '16:18:00', 2.28, 0, 0, NULL, NULL, NULL, NULL),
