(165, 'Manzana 6 P4.- Necesitan reparar los porterillos del portal. Dice que llevan mucho tiempo que no funcionan.', '2024-11-25', '2024-11-25', '3', 60, 'Bloque', NULL, NULL, NULL, 80, 21, 96.8, 165, 1, 1, 'Se hace revisión de los telefonillos en los pisos y se valoran las posibles opciones para la reparación del sistema de portero automático.\r\nRevisión Telefonillos:\r\nPiso bajo Rafael Nadarez\r\n629683869\r\nNo nos deja pasar\r\n\r\nPiso 1°1\r\nTelefonillo para cambiar.\r\nMuy antiguo.\r\nManuel Moreno \r\nTlfno  957838106\r\n\r\nPiso 1°2\r\nAntonia Marañón\r\nTelefonillo para cambiar \r\n659007403\r\n\r\nPiso 2°1\r\nCatalina Sánchez\r\n693426155.\r\nTelefonillo no sabemos si sirve para FERMAX para cambiar \r\n\r\n2°2 Tomas Mellado\r\n957204526\r\nTiene buena pinta\r\nParece universal\r\n\r\n3°2\r\nManuel Repullo\r\n640103081 Alberto nieto\r\nEs FERMAX parece ok\r\n\r\nPiso 3°1\r\nMaría Dolores Alcalde\r\n676492931\r\nTelefonillo AUTA. No sirve\r\nTelefonillo para cambiar', '13:07:00', '14:36:00', 1.48, 0, 0, NULL, NULL, NULL, 'INSPECCIÓN ESTADO INSTALACIÓN Y TFNILLOS..'),
