(178, 'Mirasierra 14.- Miguel tenemos dos registros de luz sin tapa en la escalera que baja del portal Alós trasteros\r\n\r\n650413742 ... Javi- vasco', '2024-11-29', '2024-12-04', '3', 6, 'PORTAL 14', NULL, NULL, NULL, 13.83, 21, 16.7343, 178, 1, 1, 'Se hace revisión de todos los registros empezando desde el rellano de la azotea hasta la cochera.\r\nLas tapas que faltan o estén rotas se sustituyen por tapas nuevas. \r\nY las tapas que estén sueltas se fijan con tornillos.\r\nEn total se han colocado 3 tapas nuevas cuadradas (100x100 mm )\r\nY 2 tapas nuevas redondas (80mm) \r\nTapas nuevas cuadradas 2 en 3° planta y 1 en el portal .\r\nLas 2 redondas en las escaleras de la bajada a cocheras.', '11:26:00', '13:21:00', 1.92, 0, 0, NULL, NULL, NULL, NULL),
