(183, 'Perlas 2 P8.-hay problemas de suministro eléctrico en la comunidad y que también afecta a las viviendas. \r\n\r\n617997463 ... Antonio Arenas.', '2024-12-03', '2024-12-03', '3', 1, 'PORTAL 8', NULL, NULL, NULL, 0, 21, 0, 183, 1, 1, 'Se revisa la CGP situada en el pasaje y se detecta un mal contacto en la pletina de neutro que ha dejado sin neutro a la acometida de centralización contadores del portal 8. Quitamos los 3 fusibles para intentar minorizar los posibles daños.\r\nSe hace lijado y limpieza de la pletina de conexión de neutro. Se conecta y comprueba que la conexión sea correcta antes de volver a colocar los fusibles.\r\nSe colocan fusibles y se revisan que las tensiones entre fases y fases y neutros sean correctas.', '08:47:00', '09:15:00', 0.47, 0, 0, NULL, NULL, NULL, NULL),
