(203, 'Vito 5.- Según explicaciones hace creer que el reloj de escalera no va bien.\r\n\r\n695068703 ... Rafael García.', '2024-12-09', '2024-12-10', '3', 70, 'BLOQUE VITO 5', NULL, NULL, NULL, 77.72999999999999, 21, 94.0533, 203, 1, 2, 'La luz de escalera a pulsar algún pulsador se enciende solo 2 sg y se apaga. Reloj de escalera ( minutero ) averiado. Se sustituye el mismo por uno nuevo.\r\nSe ajusta el programador digital de la luces de los porches ( 18:05 a 08:00 h ) y se comprueba que enciende todas las luces.\r\nTambién se engrasa las bisagras de la puerta del portal que chirrían mucho.', '12:36:00', '13:37:00', 1.02, 0, 0, NULL, NULL, NULL, 'RELOJ ESCALERA MALO+AJUSTAR LUCES PORCHE Y ENGRASE BISAGRAS.'),
(205, 'Isla Hierro 4 P3.-Buenos dias las puertas peatonales del bloque hierro portal 3 no abren con las llaves de proximidad y con la llave manual cuesta mucho abrir los bonvines estan deteriorados..\r\n\r\n617502442... LEONOR anterior presidenta.', '2024-12-10', '2024-12-10', '3', 9, 'COCHERAS', NULL, NULL, NULL, 56.1, 21, 67.881, 205, 1, 1, 'El módulo de control y alimentación de los 2 Abrepuertas está averiado.\r\nEste módulo es el encargado de recibí la señal de apertura desde el lector de llave de la alarma y enviar la alimentación a los 2 Abrepuertas al mismo tiempo para que cada vecino pueda salir por la puerta que le sea más próxima a su plaza.\r\nSe sustituye dicho módulo por uno nuevo y se configura el mismo.\r\nSe hace comprobación de la apertura de las 2 puertas una vez realizada la reparación.', '13:56:00', '15:46:00', 1.83, 0, 0, NULL, NULL, NULL, NULL),
