(233, 'P6- CAMBIAR EL MASTIL Y ANTENA.', '2024-10-09', '2024-10-09', '3', 6, 'PORTAL 6', NULL, NULL, NULL, 146, 21, 176.66, 233, 1, 2, 'Se instala una antena TDT nueva con todos sus elementos nuevos incluidos, en una ubicación distinta de la vieja, para evitar que las palomas cuando se posan cagen sobre la puerta de acceso a la azotea.\r\nSe conecta la antena a los equipos amplificadores ( antena colectiva modular ). Se ajustan y comprueban los niveles de señal  con medidor de campo. Se retira el mástil y todas las antenas viejas ( 3 antenas terrestres TV y 1 Satélite TV ) Se trocea el mastil viejo y nos llevamos todo lo viejo a centro de recogida de residuos.', '11:57:00', '14:27:00', 2.5, 0, 0, NULL, NULL, NULL, NULL),
(234, 'ESTA CAYENDO AGUA A LA PLAZA 6 DE LA COCHERA', '2024-10-18', '2024-10-18', '3', 6, 'PORTAL 16', 'ESTE PARTE NO SE AÑADIDO AL PROYECTO PORQUE YA SE HA HECHO FACTURA APARTE.', NULL, NULL, 80, 21, 96.8, 234, 1, 1, 'Está cayendo agua a la cochera 6 desde hace varios dias y parece que es de acometida de agua general de la línea de los pisos 3 y 1°4...el vecino del 1°4 se llama Carlos.\r\nA través del techo desmontable del cuarto baño de piso 1°4 se inspecciona con cámara de inspección a través de la falsa columna.\r\nY se localiza la zona aproximada donde se aprecia el agua para que el albañil cuando venga a romper sea lo menos posible para poder hacer la reparación \r\nEn el hueco de la falsa columna además de la tubería de acometida de agua, también está el bajante general de los baños y el desagüe de las máquinas de aire acondicionado.', '09:02:00', '10:10:00', 1.13, 0, 0, NULL, NULL, NULL, NULL),
