(266, 'ISLAS PATIO.Hacer revisión de las luces del patio.', '2024-10-11', '2024-10-11', '3', 9, 'PATIO', NULL, NULL, NULL, 23.32, 21, 28.2172, 266, 1, 1, 'ISLAS PATIO. Se hace revisión de las luces del patio. Hay una farola con la bombilla haciendo intermitencias y otra farola con la bombilla caída hacia un lado.\r\nSe sustituye la bombilla de la 1° farola por una bombilla LED nueva y se desmonta el globo y se coloca bien la bombilla de la 2° farola.', '10:46:00', '11:41:00', 0.92, 0, 0, NULL, NULL, NULL, NULL),
(267, 'ISLAS PATIO. El tirador PTA ACC 4 se sale.', '2024-11-15', '2024-11-15', '3', 9, 'PATIO', NULL, NULL, NULL, 5, 21, 6.05, 267, 1, 1, 'Se fija con 2  prisioneros tipo Allen.\r\nSe comprueba que se queda fijado fuerte a la puerta', '09:21:00', '10:06:00', 0.75, 0, 0, NULL, NULL, NULL, NULL),
(269, 'MIRASIERRA 2.- Belén , la presidenta, dice que no hay luz en el portal. Y que tampoco funciona abrir la puerta del portal \r\n636133736 ... Belén', '2024-12-27', '2024-12-27', '3', 6, 'PORTAL 2', NULL, NULL, NULL, 27.36, 21, 33.1056, 269, 1, 1, 'Se comprueba que luz si hay. Hay que tapar los detectores de movimiento porque por el día no se activan. Lo que si observamos es que las lámparas dicroicas del portal están casi todas fundidas . Hay 6 fundidas y solo encienden 2. Lo que si está pasando es que la puerta del portal no abre ni desde el pulsador del portal, ni tampoco desde los Telefonillos ni tampoco del lector de llaves de prox. Se sustituye el Abrepuertas de la puerta del portal por uno nuevo. \r\nHaciendo comprobación con Abrepuertas nuevo y funcionando, justo al rato de está comprobando falla y no abre. No le ha llegado la corriente. Se desmonta los contactos eléctricos de la puerta  y se sustituye en cable interior de la puerta por uno nuevo. Hacemos comprobación y no falla.', '14:31:00', '16:19:00', 1.8, 0, 0, NULL, NULL, NULL, NULL),
(270, 'Perlas 3 P1.- Rafael , el vocal del P1 del 2023, dice que hay una rata muerta en su cochera.\r\n666895141 ... Rafa', '2024-12-27', '2024-12-27', '3', 25, 'Cochera', NULL, NULL, NULL, 0, 21, 0, 270, 1, 1, 'Se revisa la zona de la cochera n:9 y los alrededores\r\nNo se encuentra ninguna rata', '15:17:00', '15:30:00', 0.22, 0, 0, NULL, NULL, NULL, NULL),
(271, 'Mirasierra 2.- Belén la vocal de portal dice de hacer sustitución de las 8 lámparas díacroicas que hay en el rellano de entrada junto a la cancela de la calle por lámparas algenas.\r\n636133736 ... Belén.', '2024-12-27', '2024-12-28', '3', 6, 'PORTAL 2', NULL, NULL, NULL, 53.32, 21, 64.5172, 271, 1, 1, 'Se sustituye todas las lámparas dicroicas del portal que son todavía tipo halógenas y que de 8 en total solo encienden 2. Se instalan 8 Lámparas dicroicas LEDS nuevas de 7w. Se hace la adaptación necesaria para la instalación de las mismas colocando los 8 Portalámparas también nuevos.', '10:00:00', '11:26:00', 1.43, 0, 0, NULL, NULL, NULL, NULL),
(272, 'Perlas 3.Patio.- Farola junto al portal 5 enciende muy tenue.', '2024-12-30', '2024-12-30', '3', 25, 'Patio', NULL, NULL, NULL, 12, 21, 14.52, 272, 1, 1, 'Se cambia lámpara de farola tenue por nueva led 30w 5000k', '13:58:00', '14:12:00', 0.23, 0, 0, NULL, NULL, NULL, NULL);
