INSERT INTO `presupuestos_sl` (`idParteTrabajo`, `Asunto`, `FechaAlta`, `FechaVisita`, `Estado`, `cliente_id`, `Departamento`, `Observaciones`, `condiciones_generales`, `NFactura`, `suma`, `orden_id`, `trabajo_id`, `estadoVenta`) VALUES
(1, 'Cambio de telefonillos en en todos los portales', '2024-11-01', '2024-11-02', NULL, 11, 'Portales', 'En caso de sobrepasar el tiempo limite de validez de esta oferta/informe rogamos vuelvan a consultar precios, no olvide que estamos en constante renovación a fin de ofrecerle la mejor relación calidad/precio de nuestros trabajos. Todo el material empleado en nuestros trabajos cumplirá las especificaciones técnicas reglamentarias  al uso que ha sido destinado. Se efectuaran revisiones periódicas gratuitas cada tres meses a fin de asegurar el buen uso y funcionamiento del producto. Esta garantía queda extinta en su totalidad por siniestros derivados de inclemencias meteorológicas, manipulación por personal ajeno a la empresa y/o actos vandálicos. Los daños derivados directos o indirectos como causa de los trabajos realizados serán evaluados y si procediera valorados y/o reparados por personal técnico enviado por la propia empresa siendo responsabilidad del cliente o afectado el facilitar el acceso en el tiempo y forma por la misma. Todos nuestros equipos y materiales tienen certificado de homologación por la CE.', 'Este presupuesto, en adelante acuerdo, carecerá de validez si no está firmado por parte de la empresa y del cliente.\r\n1- Este presupuesto/acuerdo tendrá una validez de dos meses a partir de la fecha arriba indicada.\r\n2- En los precios no está incluido ningún tipo de impuesto.\r\n3- Quedarán excluidas todas las modificaciones, rectificaciones, reparaciones o ampliaciones que difieran de los trabajos presupuestados y reflejados en el presente escrito.\r\n4- El cliente quedará obligado al suministro de puntos de agua, luz según sean necesarios, así como los permisos legales y/o dirección de obra o en su defecto documentación acreditativa necesaria para su gestión, sea de cualquier carácter (tasas obligatorias, subvenciones, etc.), si la empresa lo necesitase, y facilitará el paso al lugar donde se efectuarán los trabajos. En ningún caso será responsabilidad de la empresa la omisión y/o negación de la citada documentación/permisos/dirección de obra, etc., quedando relegada en su totalidad al cliente.\r\n5- En caso de que la empresa gestione subvenciones de cualquier tipo, la empresa no se hará responsable de los resultados/resoluciones de las mismas, ya que dicha decisión corresponde solo al organismo ante el que se gestiona.\r\n6- La forma de pago de todos los trabajos será del 30% a la formalización del acuerdo, 40% al comienzo de la obra y 30% a la finalización de la misma, no pudiendo modificarse sin acuerdo previo por las partes firmantes. Para la resolución de cualquier litigio serán competentes los Juzgados y Tribunales de la ciudad de Córdoba, con renuncia a cualquier otro.', NULL, 0, NULL, NULL, 1),
(2, 'Cambio de telefonillos en todos los portales', '2024-11-01', '2024-11-02', NULL, 1, 'Portales', 'En caso de sobrepasar el tiempo limite de validez de esta oferta/informe rogamos vuelvan a consultar precios, no olvide que estamos en constante renovación a fin de ofrecerle la mejor relación calidad/precio de nuestros trabajos. Todo el material empleado en nuestros trabajos cumplirá las especificaciones técnicas reglamentarias  al uso que ha sido destinado. Se efectuaran revisiones periódicas gratuitas cada tres meses a fin de asegurar el buen uso y funcionamiento del producto. Esta garantía queda extinta en su totalidad por siniestros derivados de inclemencias meteorológicas, manipulación por personal ajeno a la empresa y/o actos vandálicos. Los daños derivados directos o indirectos como causa de los trabajos realizados serán evaluados y si procediera valorados y/o reparados por personal técnico enviado por la propia empresa siendo responsabilidad del cliente o afectado el facilitar el acceso en el tiempo y forma por la misma. Todos nuestros equipos y materiales tienen certificado de homologación por la CE.', 'Este presupuesto, en adelante acuerdo, carecerá de validez si no está firmado por parte de la empresa y del cliente.\r\n1- Este presupuesto/acuerdo tendrá una validez de dos meses a partir de la fecha arriba indicada.\r\n2- En los precios no está incluido ningún tipo de impuesto.\r\n3- Quedarán excluidas todas las modificaciones, rectificaciones, reparaciones o ampliaciones que difieran de los trabajos presupuestados y reflejados en el presente escrito.\r\n4- El cliente quedará obligado al suministro de puntos de agua, luz según sean necesarios, así como los permisos legales y/o dirección de obra o en su defecto documentación acreditativa necesaria para su gestión, sea de cualquier carácter (tasas obligatorias, subvenciones, etc.), si la empresa lo necesitase, y facilitará el paso al lugar donde se efectuarán los trabajos. En ningún caso será responsabilidad de la empresa la omisión y/o negación de la citada documentación/permisos/dirección de obra, etc., quedando relegada en su totalidad al cliente.\r\n5- En caso de que la empresa gestione subvenciones de cualquier tipo, la empresa no se hará responsable de los resultados/resoluciones de las mismas, ya que dicha decisión corresponde solo al organismo ante el que se gestiona.\r\n6- La forma de pago de todos los trabajos será del 30% a la formalización del acuerdo, 40% al comienzo de la obra y 30% a la finalización de la misma, no pudiendo modificarse sin acuerdo previo por las partes firmantes. Para la resolución de cualquier litigio serán competentes los Juzgados y Tribunales de la ciudad de Córdoba, con renuncia a cualquier otro.', NULL, 700, NULL, NULL, 1),
