INSERT INTO `ventas_lineas_sl` (`idLineaVenta`, `Descripcion`, `Cantidad`, `precioSinIva`, `descuento`, `total`, `venta_id`, `proyecto_id`, `orden_trabajo`, `parte_trabajo`, `tipo_orden`, `observaciones`) VALUES
(1, 'Descripcion de la parte Segundo capitulo', 1, 80, 0, 80, 130, NULL, 134, 134, 'parte', 'Venta realizada por el usuario: TECNICO 001'),
(2, 'Agregar Zip a los partes de trabajo', 1, 108.5, 0, 108.5, 132, NULL, 57, 57, 'parte', 'Venta realizada por el usuario: TECNICO 001'),
(3, 'APLICACIÓN PARA SEBASTIÁN Problemas datos del nuevo proveedor...Falta teléfono y además que hay demasiados campos obligatorios...No se que le parece a Miguel Ángel, pero yo dejaría obligatorio solo CIF y NOMBRE', 1, 15, 0, 18.15, 133, 12, 45, 45, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(4, 'APLICACIÓN Añadir campos expansibles en partes de trabajo', 1, 15, 0, 18.15, 133, 12, 46, 46, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(5, 'APLICACIÓN MODIFICAR MENU.', 1, 45, 0, 54.45, 133, 12, 52, 52, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(6, 'APLICACIÓN ... En pantalla de partes de trabajo A hacer doble click en los campos que queremos leer completos no conseguimos leer todo el texto ... Ver video..', 1, 30, 0, 36.3, 133, 12, 53, 53, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(7, 'Este campo Asunto hacerlo que sea Campo de texto autoextensible en Citas y Órdenes y Partes. ( Creo que en partes de trabajo ya está hecho .\r\nSe tiene que ver el texto entero\r\nSe tiene que ver el texto entero\r\nE\r\nN\r\nT\r\nE\r\nR\r\nO', 1, 55, 0, 66.55, 133, 12, 54, 54, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(8, 'Técnico 2 ya está haciendo los partes de trabajo por la aplicación y esta mañana hemos tenido que ir por segunda vez al mismo trabajo con lo cual cuando termine el parte de trabajo de esta mañana tendrá que hacer su primer proyecto... \r\n\r\nY en esta pantalla se hace necesario que muestre la columna proyectos para poder filtrar y ver que están todas las tareas debidamente registradas.', 1, 20, 0, 24.2, 133, 12, 56, 56, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(9, 'PROYECTOS CON SU NÚMERO CORRESPONDIENTE EN LA ETIQUETA.... ya que como nos dedicamos a trabajos muy similares en en distintos sitios pero muy semejantes el nombre de los proyectos muchas veces va a coincidir y sería necesario que aparezca el número para no confundirlos.', 1, 25, 0, 30.25, 133, 12, 63, 63, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(10, 'Añadir campo número teléfono en proveedor', 1, 10, 0, 11, 133, 12, 64, 64, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(11, 'Proyecto-Se requiere un indicativo que muestre cuando los archivos se están subiendo.', 1, 10, 0, 11, 133, 12, 69, 69, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(12, 'Implementar histórico de artículos desde modulo de partes de trabajo', 1, 30, 0, 33, 133, 12, 71, 71, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
(13, 'Otro tema que ya te comenté hace tiempo ...\r\n\r\nComo ahora estamos haciendo más uso de las citas y órdenes de trabajo... Me gustaría enviar las órdenes de trabajo nuevas al chat de \"Mileco avisos entrantes\"... \r\n\r\nPero a mí  me gustaría saber cómo se hace por si a futuro quisiera enviarlo a otro chat... Y quisiera saber hacerlo yo \r\n\r\n Puedes enviar el vídeo de esto..?', 1, 10, 0, 11, 133, 12, 80, 80, 'parte', 'Venta realizada por el usuario: TECNICO 009'),
